import React from 'react';
import { makeStyles } from '@material-ui/core';
import { ReactComponent as ABCLogo } from '../assets/companyLogo.svg';
import { ReactComponent as HRCLogo } from '../assets/hrcLogo.svg';
import { pxToRem } from '../utils/theme';

const useStyles = makeStyles((theme) => ({
    ABCCOntainer: {
        display: 'flex',
    },
    ABCLogo: {
        top: pxToRem('20px'),
        left: pxToRem('30px'),
        width: pxToRem('44px'),
        height: pxToRem('46px'),
        padding: pxToRem('10px'),
    },
    ABCText: {
        font: 'normal normal bold 39px/50px Futura PT',
        color: '#FFFFFF',
        // display: 'flex',
    }
}))

const Header = (props) => {
    const classes = useStyles();
    return (
        <div>
            <div className={classes.ABCCOntainer}>
                <div>
                    <ABCLogo/> 
                </div>
                <div className={classes.ABCText}>
                    ABC Products
                </div>
            </div>
        </div>
    )
}

const LandingPage = (props) => {
    return (
        <div>
            <Header/>
        </div>
    )
}

export default LandingPage;
